                    "textContent": "\n      html, body {\n        overflow-x: hidden;\n        font-family: 'Poppins', sans-serif !important;\n      }\n      .m-primary-desc {\n        display: none;\n      }\n      .m-primary-img img {\n        margin-top: -12px;\n        margin-bottom: 22px;\n      }\n      .l-primary-img {\n        display: none;\n      }\n      .px-8-mobile {\n        margin-left: -18px;\n      }\n      @media (min-width:768px){\n        .m-primary-img {\n          display: none;\n        }\n        .l-primary-img {\n          display: block;\n        }\n        .m-primary-desc {\n          display: block;\n        }\n        .px-8-mobile {\n          margin: auto;\n        }\n      }\n      .buttons .button {\n          border-radius: 6px;\n      }\n      .arrow {\n        text-align: center;\n        margin: 8% 0;\n        display: inline-block;\n      }\n      .bounce {\n        -webkit-animation: bounce 2s infinite;\n        animation: bounce 2s infinite;\n      }\n      @-webkit-keyframes bounce {\n        0%,\n        20%,\n        50%,\n        80%,\n        100% {\n          transform: translateY(0);\n        }\n        40% {\n          transform: translateY(-30px);\n        }\n        60% {\n          transform: translateY(-15px);\n        }\n      }\n      @keyframes bounce {\n        0%,\n        20%,\n        50%,\n        80%,\n        100% {\n          transform: translateY(0);\n        }\n        40% {\n          transform: translateY(-30px);\n        }\n        60% {\n          transform: translateY(-15px);\n        }\n      }\n      .gray-hr.hidden {\n        display: block;\n      }\n      .gray-hr {\n        height: 1px;width:50%;border-width:0;color: #ececec;background-color: #ececec;width: 100%;margin-top: 4px;width: 300vw;margin-left: -20%;\n      }\n      .column {\n        padding: 0.65rem;\n      }\n      .navbar-item, .navbar-link {\n          padding: 0.5rem 1.5rem;\n          font-size: .875rem;\n          font-weight